import React, { useEffect, useState } from 'react';
import AdviceCard from './components/AdviceCard'
function App() {

  const[advices, setAdvices] = useState([])

  useEffect(
    fetch('https://api.adviceslip.com/advice')
    .then(resp => resp.json())
    .then(advice => setAdvices(advice))
  )

  return (
    <AdviceCard />
  );
}

export default App;
